//Test Data API

const testPurchases = [
    {"producer": "Louises farm", "item": "tomatoes", "amount": 4},
    {"producer": "Ellens vegetables", "item": "potatoes", "amount": 3},
    {"producer": "Nils-Martins ranch", "item": "eggs", "amount": 20},
    {"producer": "Henriks meat", "item": "beef", "amount": 6}
]
export default testPurchases
